package FinalDemo.com;

//final class cannot be inherited by another class 
 class KKK
{
	void test()
	{
		System.out.println("Test in parent");
	}
	
	void show()
	{
		System.out.println("show in parent");
	}
	
	
}

class JJJ extends KKK
{
	
	void test()
	{
		System.out.println("Test in parent");
	}
	
	void show()
	{
		System.out.println("show in parent");
	}
	
}












